INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Diablo 3 Battlechest', 'diablo3.png', 'Twenty years have passed since the Prime Evils were defeated and banished from the world of Sanctuary. Now, you must return to where it all began – the town of Tristram – and investigate rumors of a fallen star, for this is the first sign of evil’s rebirth, and an omen that the End Times have begun.', 199, 5)
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Tom Clancy’s Ghost Recon® Breakpoint Auroa Edition', 'GhostRecon.jpg', 'Tom Clancy’s Ghost Recon Breakpoint is a military shooter that features a massive and visually stunning open world, playable for the first time in solo or online in four-player co-op. Injured, without support, and hunted down by ex-Ghosts, you must fight to survive while lost in Auroa. Choose the right alliances and decide how to take down your toughest enemies ever: The Wolves.', 249, 20)
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Fortnite: Deep Freeze Bundle', 'FortNite.jpg', 'THE BATTLE IS BUILDING! Fortnite Battle Royale is the FREE 100-player Pvp mode in Fortnite. One giant map. A battle bus. Fortnite building skills and destructible environments combined with intense PvP combat. The last one standing wins.', 99, 15)
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Mortal Kombat 11', 'MortalKombat11.jpg', 'Mortal Kombat is back and better than ever in the next evolution of the iconic franchise. The all new Custom Character Variations give you unprecedented control to customise the fighters and make them your own. The new graphics engine showcasing every skull-shattering, eye-popping moment, brings you so close to the fight you can feel it. And featuring a roster of new and returning Klassic Fighters, Mortal Kombat’s best in class cinematic story mode continues the epic saga over 25 years in the making.', 229, 48)
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Grand Theft Auto V', 'GrandTheftAuto5.jpg', 'The Grand Theft Auto V: Premium Edition includes the complete Grand Theft Auto V story experience, free access to the ever-evolving Grand Theft Auto Online and all existing gameplay upgrades and content including The Doomsday Heist, Gunrunning, Smuggler’s Run, Bikers and much more. You’ll also get the Criminal Enterprise Starter Pack, the fastest way to jumpstart your criminal empire in Grand Theft Auto Online.', 199, 60)
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('The Long Dark', 'TheLongDark.jpg', 'WELCOME TO THE QUIET APOCALYPSE Bright lights flare across the night sky. The wind rages outside the thin walls of your wooden cabin. A wolf howls in the distance. You look at the meagre supplies in your pack, and wish for the days before the power mysteriously went out. How much longer will you survive? The Long Dark is a thoughtful, exploration-survival experience that challenges solo players to think for themselves as they explore an expansive frozen wilderness in the aftermath of a geomagnetic disaster. There are no zombies -- only you, the cold, and all the threats Mother Nature can muster.', 299, 78)
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Max: The Curse of Brotherhood', 'Max.jpg', 'A warm summer day, Max comes home from school and finds his room in a mess. His little brother Felix is playing with his toys again! In anger, Max turns to his laptop and makes a search: “How to make your brother disappear”. Max: The Curse of Brotherhood is a cinematic adventure filled with action-packed platforming and creative puzzle-solving. Armed with only a Magic Marker, Max must confront evil at every turn in a hostile and fantastical world in order to save his kid brother, Felix. Fortunately, the Magic Marker has the power to bend the elements and create magic objects that can help Max on his quest. Join Max on the greatest adventure of his life!', 199, 19)
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Shadow of the Colossus', 'ShadowColossus.jpg', 'ET OVERVÆLDENDE EVENTYR - Stærkt og rørende Oplev den storslåede skønhed i et af de mest kritikerroste og elskede spil nogensinde, nu på PS4 og PS4 Pro.
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Black Mirror', 'BlackMirror.jpg', 'Blood is not always thicker than water. Scotland, 1926. Following the suicide of his father, David Gordon visits his ancestral home for the first time in his life. A life that is soon threatened by the dark secrets that claimed the sanity of many Gordons before him.
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Lego Ninjago', 'TheNinjagoMovie.jpg', 'In the game, players battle their way through waves of enemies with honour and skill as their favourite ninjas Lloyd, Nya, Jay, Kai, Cole, Zane and Master Wu to defend their home island of Ninjago from the evil Lord Garmadon and his Shark Army. To do so, they must master the art of Ninjagility which allows them to traverse Ninjago by wall-running, high-jumping and battling the foes of Ninjago to rank up and upgrade the ninja’s combat skills. Players can harness the power of Spinjitzu combat to defend Ninjago together.
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('White Day: A Labyrinth named School', 'WhiteDay.jpg', 'Starting a new school is never easy, especially when its one plagued by rumours of violent murders and vengeful spirits. Forget the sweats brought on by surprise maths tests: the horrors roaming the halls of Yeondoo High School can outright kill you.
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Dark Souls III - The Fire Fades Edition', 'DarkSouls3.jpg','The Dark Souls III - The Fire Fades™ Edition includes the full game & the Season Pass. Expand your experience with the Season Pass featuring new maps, bosses, enemies and additional weapon and armor sets.
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Troll And I', 'TrollAndI.jpg','Deep in the Nordic wilderness, a teenage boy named Otto is forced to flee his home after a band of brutal hunters rip through his village in search of a mythical creature rumored to inhabit the forest. Now on the run for his life, Otto inadvertently finds and befriends the elusive creature being sought by the hunters. Thus begins the perilous adventure of Troll and Otto.
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('The Legend of Zelda: Breath of the Wild', 'Zelda.jpg','Step into a world of adventure
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Horizon Zero Dawn', 'HorizonZeroDawn.jpg','Survive a new wilderness dominated by herds of fearsome machines, warring tribes and age-old secrets in an all-action RPG adventure from the makers of KILLZONE™. 
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Uncharted 4: A Thiefs End', 'Uncharted4.jpg','A return to the fray Brothers in harms way Set three years after the events of Uncharted 3: Drake’s Deception, Nathan Drake has presumably left the world of fortune hunting behind. However, it doesn’t take long for fate to come calling when Drake’s brother, Sam, resurfaces seeking his help to save his own life and offering an adventure Drake can’t resist.
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Assassins Creed Chronicles', 'AssassinsCreed.jpg','Assassins Creed® Chronicles: China Assassins Creed Chronicles: China takes place in China, 1526, as the Ming dynasty starts to crumble. You embody Shao Jun, the last remaining Assassin of the Chinese Brotherhood, returning to her homeland with a vendetta. Newly trained by the legendary Ezio Auditore, she is hell-bent on exacting vengeance and restoring her fallen Brotherhood.', 249, 56)
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Lego Jurassic World', 'LegoJurassicWorld.jpg','Following the epic storylines of Jurassic Park, The Lost World: Jurassic Park and Jurassic Park III, as well as the highly anticipated Jurassic World, LEGO® Jurassic World™ is the first videogame where players will be able to relive and experience all four Jurassic films. Reimagined in LEGO form and told in TT Games’ signature classic LEGO humour, the thrilling adventure recreates unforgettable scenes and action sequences from the films, allowing fans to play through key moments and giving them the opportunity to fully explore the expansive grounds of Isla Nublar and Isla Sorna.', 99, 87)
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('The Evil Within', 'TheEvilWithin.jpg','Shinji Mikami, the father of survival horror, is back to direct The Evil Within™ - a game embodying the meaning of pure survival horror. Highly-crafted environments, horrifying anxiety, and an intricate story weave together to create an immersive world that will bring players to the height of tension. The Evil Within is in development for the Xbox One, Xbox 360, PlayStation 4, PlayStation 3, and PC and is slated for release in 2014.', 149, 42)
INSERT INTO Product ([Name], [Url], [Description] , Unitprice, Stock) VALUES ('Natural Doctrine', 'NaturalDoctrine.jpg','Strategy role-playing gamers be ready, as this game will truly test your ability to conquer the evils that lurk in the sprawling networks of mines and ruins in the areas surrounding the fortress city of Feste. Seasoned explorers and novices alike venture underground into dangerous caves to collect the coveted material known as Pluton. During your first trip down into the depths of one of these mines, you and your new explorer friends quickly realize that things may be more dire than you had imagined as you encounter a brand-new type of evil lurking below the surface. You and your newfound friends must strategically defeat these new difficult foes and warn the kingdom of their presence before its too late.', 299, 5)
