USE [Product]


Takket være Bluepoint Games har følsomheden, intensiteten og skønheden i Fumito Uedas originale eventyr fået en forbløffende overhaling. Hvert eneste øjeblik er endnu mere bjergtagende og uforglemmeligt end nogensinde før med forbedret grafik og ydeevne.
Du skal vække en ung pige til live – men 16 mægtige kolosser står i vejen. Du har kun din skarpe forstand, et magisk sværd og en bue, og sådan må du ride ud over de enorme sletter på ryggen af din trofaste hest for at finde kolosserne.', 299, 5)
Tormented by nightmares and waking dreams for all his life, David fears that it might be his destiny to follow in his father’s footsteps, down a path that leads to madness, and death. Is there really a Curse that has been haunting his family, like his father believed? It is up to David to uncover the horrible truths, buried under generations of silence and fathoms of stone. Black Mirror Castle demands an offering...
"I became insane, with long intervals of horrible sanity." Edgar Allen Poe Like in the original graphic adventure trilogy, the Gothic Horror genre and its unique atmosphere of madness and psychological distress remains at the heart of Black Mirror. The point-and-click gameplay of the original trilogy served as the basis for the re-imagined gameplay, which focuses on close-up investigation and interaction with nightmarish 
visions that plague the protagonist of the game David Gordon. "They who dream by day are cognizant of many things which escape those who dream only by night." Edgar Allan Poe David Gordon never knew his estranged father particularly well. Still it comes as a shock when he is summoned to his familys ancestral home in the Scottish highlands, after his father has taken his own life there. David does not know much about his 
fathers final weeks, but the circumstances of his death seem more than peculiar. Settling the heritage is merely an excuse for David to find out more about the castle his father grew up in, meeting the family he never knew and for shedding light on the mysteries surrounding his fathers death. Tormented by nightmares and waking dreams for all his life, he fears that it might be his destiny to follow in his fathers footsteps, 
down a path that leads to madness and death. Is there really a curse that has been haunting his family for generations as his father believed? Or are the mysteries hidden inside the cold walls of Black Mirror house of a far more wordly nature? It is up to David to uncover the horrible truths, buried under generations of silence and fathoms of stone.', 79, 97)
The game features eight large, action-packed locations based on the story of The LEGO NINJAGO Movie. Each location includes its own unique Challenge Dojo where players can put their combat skills to the test and battle with increasingly tougher enemies. And with Battle Maps, players can go up against their friends and family in four different game modes, with competitive split-screen local gameplay for up to four players.', 149, 5)

Unfortunately, when a good deed for a fellow student goes wrong youre locked in with them all overnight. With not even a pointy pencil to hide behind youve got to carefully creep through the dark corridors and lecture halls in a psychological first-person frightfest brimming with supernatural terrors, hidden secrets and classic survival horror genre puzzles. All the while, 
a killer janitor stalks your every move as you make a frantic bid for freedom. Can you keep your nerve and mastermind a way out of the nightmare? Or will your name be scratched off the next mornings roll call sheet and added to the growing list of victims the building has claimed?', 249, 51)
As fires fade and the world falls into ruin, journey once more into a universe filled with more colossal enemies and environments. Fans and newcomers alike will get lost in the games hallmark rewarding gameplay and immersive graphics. Now only embers remain…', 149, 46)
Together, the unlikely friends embark on a journey through treacherous territory plagued with rivals. Natives to the forest, Troll and Otto must use their inherent skills to sneak, strategize, and battle their way back home. The forest is filled with unknowns, and teamwork is pivotal to staying alive.', 99, 62)
Forget everything you know about The Legend of Zelda games. Step into a world of discovery, exploration and adventure in The Legend of Zelda: Breath of the Wild, a boundary-breaking new game in the acclaimed series. Travel across fields, through forests and to mountain peaks as you discover what has become of the ruined kingdom of Hyrule in this stunning open-air adventure. Explore the wilds of Hyrule any way you like
Climb up towers and mountain peaks in search of new destinations, then set your own path to get there and plunge into the wilderness. Along the way, youll battle towering enemies, hunt wild beasts and gather ingredients for the food and elixirs youll need to sustain you on your journey. More than 100 Shrines of Trials to discover and explore Shrines dot the landscape, waiting to be discovered in any order you want. 
Search for them in various ways, and solve a variety of puzzles inside. Work your way through the traps and devices inside to earn special items and other rewards that will help you on your adventure. Be prepared and properly equipped With an entire world waiting to be explored, youll need a variety of outfits and gear to reach every corner. You may need to bundle up with warmer clothes or change into something better 
suited to the desert heat. Some clothing even has special effects that, for example, can make you faster and stealthier. Battling enemies requires strategy The world is inhabited with enemies of all shapes and sizes. Each one has its own attack method and weaponry, so you must think quickly and develop the right strategies to defeat them. amiibo compatibility You can tap the Wolf Link amiibo (sold separately) to make 
Wolf Link appear in-game. Wolf Link will attack enemies on his own and help you find items youre searching for. We will also introduce new The Legend of Zelda: Breath of the Wild series amiibo at E3 this year.', 599, 64)
Harness the agility, cunning and deadly aim of Aloy − an expert hunter cast out from her tribe at birth – to defy overwhelming odds and turn deadly predators into defenceless prey. Alone on your quest in an unforgiving, post-apocalyptic world, can you solve the riddle of your birth and bring to light the deepest and darkest mysteries of the ancient past?', 249, 91)

On the hunt for Captain Henry Avery’s long-lost treasure, Sam and Drake set off to find Libertalia, the pirate utopia deep in the forests of Madagascar. Uncharted 4: A Thief’s End takes players on a journey around the globe, through jungle isles, far-flung cities and snow-capped peaks on the search for Avery’s fortune.', 149, 87)







































































